import { store } from './redux/store';
import { BrowserRouter as Router , Routes , Route } from 'react-router-dom';
import './App.css';
import Cover from './Container/Cover/Cover';
import { Provider } from 'react-redux';


function App() {

  return (
    <Router>
       <Provider store={store}>
        <div className="App">
          <Cover />
        </div>
     </Provider>
    </Router>


  );
}

export default App;
